import { useParams } from "react-router-dom";
import styled from "styled-components";
const Title = styled.h1`
color: ${(props) => props.theme.accentColor};
`;

interface RouteParams {
  coinId: string;
}

const Coin = () => {
  const { coinId } = useParams<RouteParams>();
  return(
    <h1>상세코인: { coinId }</h1>
  )
}
export default Coin;
